INSERT INTO `wp_posts` VALUES (1,1,'2015-08-18 20:22:26','2015-08-18 20:22:26','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!','Hello world!','','trash','open','open','','hello-world','','','2015-11-30 18:51:25','2015-11-30 18:51:25','',0,'http://higg0.wpengine.com/?p=1',0,'post','',1),(2,1,'2015-08-18 20:22:26','2015-08-18 20:22:26','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://higg0.wpengine.com/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','publish','open','open','','sample-page','','','2015-08-18 20:22:26','2015-08-18 20:22:26','',0,'http://higg0.wpengine.com/?page_id=2',0,'page','',0),(4,2,'2015-10-27 14:50:45','2015-10-27 14:50:45','Well hello there! This is Patrick\'s Hello World!\r\n\r\n<a href=\"http://higg0.wpengine.com/wp-content/uploads/2015/10/Spaceman-Spiff.gif\"><img class=\"alignnone size-full wp-image-8\" src=\"http://higg0.wpengine.com/wp-content/uploads/2015/10/Spaceman-Spiff.gif\" alt=\"Spaceman Spiff!\" width=\"142\" height=\"125\" /></a>\r\n\r\n<script type=\"text/javascript\">\r\njQuery(document).ready(function() {\r\njQuery(\".entry-title\").html(\"New Title\");\r\nconsole.log(\"Hello World\");\r\nvar someText = \"Here\'s some text\";\r\nvar x = 1;\r\nvar x = 2;\r\n});\r\n</script>','Patrick\'s Hello World!','','publish','closed','closed','','patricks-hello-world','','','2015-11-10 15:23:19','2015-11-10 15:23:19','',0,'http://higg0.wpengine.com/?page_id=4',0,'page','',0),(7,3,'2015-10-27 14:45:30','2015-10-27 14:45:30','Hello world!\r\n\r\nIt\'s great to be a part of this team.\r\n\r\nMy nickname in college was \"<a href=\"https://en.wikipedia.org/wiki/Baloo\" target=\"_blank\">Baloo</a>,\" as in the bear from <em>The Jungle Book</em>.\r\n\r\n<img class=\"alignnone\" src=\"https://upload.wikimedia.org/wikipedia/en/2/25/Baloo_the_bear.jpg\" alt=\"I look even better in a skirt than he does!\" width=\"316\" height=\"315\" />','Ross Hello World','','publish','closed','closed','','ross-hello-world','','','2015-10-27 14:45:30','2015-10-27 14:45:30','',0,'http://higg0.wpengine.com/?page_id=7',0,'page','',0),(8,2,'2015-10-27 14:54:31','2015-10-27 14:54:31','Spaceman Spiff!','Spaceman Spiff!','','inherit','open','closed','','spaceman-spiff','','','2015-10-27 14:54:46','2015-10-27 14:54:46','',4,'http://higg0.wpengine.com/wp-content/uploads/2015/10/Spaceman-Spiff.gif',0,'attachment','image/gif',0),(10,4,'2015-10-27 15:05:09','2015-10-27 15:05:09','Hello World! It\'s Word Press, stupid<script src=\"https://apis.google.com/_/scs/abc-static/_/js/k=gapi.gapi.en.xjOqtrB8Fx8.O/m=gapi_iframes,googleapis_client,plusone/rt=j/sv=1/d=1/ed=1/am=AAQ/rs=AItRSTOblpNtoWHpPOhBTtm7mc3TCZFA0g/cb=gapi.loaded_0\" async=\"\"></script><script>// <![CDATA[\r\n(function(){window.google={kEI:\'gpIvVrLWGou5-QGztbzoCQ\',kEXPI:\'3700315,4029815,4031109,4032678,4033307,4033344,4036211,4036527,4037333,4037569,4037688,4038012,4038214,4038437,4041440,4041776,4041837,4041899,4042158,4042367,4042375,4042490,4043255,4043457,4043458,4043492,4043568,4044246,4044606,4045293,4045841,4045873,4046043,4046304,4046374,4046375,4046376,4046400,4046835,