 can create self-guided tours for your visitors, add interesting and informative content to existing tours, and gain insights on your visitors with our analytics package.\r\n\r\nGet started today and bring your tours into the digital age!\r\n\r\nHi Fellow Tour Guides!\r\n\r\nThank you for visiting us at Beacon Tours, founded through a love of travel and the beautiful places we visit. That passion drives us at Beacon Tours to serve those just like us through a tool that creates and shares your traveling experiences with others.\r\n\r\nGet started today and bring your passion into our community today!','Beacon Tours','','publish','closed','closed','','home','','','2015-11-03 16:04:26','2015-11-03 16:04:26','',0,'http://higg0.wpengine.com/?page_id=17',0,'page','',0),(19,2,'2015-11-02 14:22:53','2015-11-02 14:22:53','<!-- Note - this additional style sheet ref brings in icons. See here - http://www.w3schools.com/w3css/w3css_icons.asp -->\r\n<link rel=\"stylesheet\" href=\"http://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.4.0/css/font-awesome.min.css\">\r\n\r\n<!-- Content -->\r\n\r\n<div class=\"maps\">[wpgmza id=\"1\"]</div>\r\n\r\n<!-- \r\nSome broken jQuery below...can\'t add < character w/o enqueing the jQuery library - https://wordpress.org/support/topic/use-jquery-append-function\r\n        jQuery(\"#available-stops tbody\").append(\"<tr>\"+toMove+\"</tr>)\r\nAlso, same problem in adding a row back to active stops.\r\n-->\r\n\r\n<!-- jQuery to delete a row and move it to unused -->\r\n<script type=\"text/javascript\">\r\njQuery(document).ready(function(){\r\n    jQuery(document).on(\"click\", \".delete-stop\", function(){\r\n        var toMove = jQuery(this).parent();\r\n        console.log(toMove);\r\n        jQuery(\"#available-stops tbody\").append(toMove)\r\n    });\r\n    jQuery(document).on(\"click\", \".delete-stop\", function(){\r\n        var toDelete = jQuery(this).parent();\r\n        console.log(toDelete);\r\n        jQuery(toDelete).remove();\r\n  