p for some caffeine and light snacks. Originally an iLab project, Shark Mountain has been growing strong ever since!</td> \n    <td class=\"delete-stop\"><i class=\"fa fa-close\"></i></td>\n  </tr>\n<tr>\n    <td class=\"stop-number\">3</td>\n    <td class=\"stop-name\">Classroom</td>\n    <td class=\"stop-description\">Home of GBUS (insert some combination of 4 numbers).</td> \n    <td class=\"delete-stop\"><i class=\"fa fa-close\"></i></td>\n</tr>\n</tbody>\n</table>\n\n\n<table id=\"available-stops\">\n  <caption class=\"stops-table-title\">Stops Available For Use</caption>\n  <tbody>\n  <tr>\n    <td class=\"stop-number\">4</td>\n    <td class=\"stop-name\">Secret Entrance</td>\n    <td class=\"stop-description\">If you are special enough, you can enter here.</td> \n    <td class=\"add-stop\"><i class=\"fa fa-plus\"></i></td>\n  </tr>\n  </tbody>\n</table>\n\n<!-- \nSome broken jQuery below...can\'t add < character w/o enqueing the jQuery library - https://wordpress.org/support/topic/use-jquery-append-function\n        jQuery(\"#available-stops tbody\").append(\"<tr>\"+toMove+\"</tr>)\nAlso, same problem in adding a row back to active stops.\n-->\n\n<!-- jQuery to delete a row and move it to unused -->\n<script type=\"text/javascript\">\njQuery(document).ready(function(){\n    jQuery(document).on(\"click\", \".delete-stop\", function(){\n        var toMove = jQuery(this).parent();\n        console.log(toMove);\n        jQuery(\"#available-stops tbody\").append(toMove)\n    });\n    jQuery(document).on(\"click\", \".delete-stop\", function(){\n        var toDelete = jQuery(this).parent();\n        console.log(toDelete);\n        jQuery(toDelete).remove();\n    });\n}); \n</script>\n\n<!-- jQuery to add a row up to active stops and remove it from below -->\n<script type=\"text/javascript\">\njQuery(document).ready(function(){\n    jQuery(document).on(\"click\", \".add-stop\", function(){\n        var toMove = jQuery(this).parent();\n        console.log(toMove);\n 